(10, 'Nimban Outpost', 'Resistance Ordnance and Supply sells a wide variety of military surplus goods from it\'s base in the Arkanis sector. The Nimban outpost primarily deals in medical supplies.', 'https://www.swcombine.com/ws/v2.0/faction/20%3A1333/'),
